import React from 'react'
import { AppBar, Box, Toolbar, Typography, Button } from '@mui/material'
import { NavLink } from 'react-router-dom'

const Navbar=()=> {
  return (
   <Box sx={{flexGrow:2}}>
    <AppBar position='static' color='Navy'>
        <Toolbar>
            <Typography fontSize={24} fontFamily='forte' varient ='h5' component="div" sx={{flexGrow:1}}>
                Auth-Web-App
            </Typography>
            <Button component={NavLink} to='/' style={({isActive})=>{return{backgroundColor: isActive ? 'darkblue' : ''}}} sx={{color:'white' , textTransform: 'none'}}>Home </Button>
            <Button component={NavLink} to='/LogReg' style={({isActive})=>{return{backgroundColor: isActive ? 'darkblue' : ''}}} sx={{color:'white', textTransform: 'none' }}>Sign-in </Button>
        </Toolbar>
    </AppBar>
   </Box>
  );
}

export default Navbar;
